angular.module("templates",[]).run(["$templateCache",function($templateCache){$templateCache.put("/home/home.html",'<div class="container-fluid"><div class="row"><div ng-repeat="widget in widgets track by $index" class="col-lg-3 col-md-4 col-sm-6"><div class="well"><button type="button" ng-click="deleteWidget($index)" class="close">&times;</button><h4>Name</h4><p>{{widget.name}}</p><h4>Description</h4><p>{{widget.description}}</p></div></div><div class="col-lg-3 col-md-4 col-sm-6"><div class="well text-center"><div ng-switch="widgets.length"><p ng-switch-when="0" class="lead">You haven\'t created any widgets yet!</p><p ng-switch-default="ng-switch-default" class="lead">Create More Widgets</p></div><a ui-sref="widget-builder" class="btn btn-default btn-lg"><span class="glyphicon glyphicon-plus"></span></a></div></div></div></div>'),$templateCache.put("/widget/widget-builder.html",'<div class="container-fluid"><div class="row"><div class="col-md-12"><p class="lead">Let\'s build some widgets.</p></div></div><kc-widget-form on-submit="submit($widgets)"></kc-widget-form></div>'),$templateCache.put("/widget/widget-form.html",'<div class="row"><div class="col-lg-6 col-md-8 col-sm-6"><kc-permutable-attributes permutable-attributes="state.permutable_attributes" build-permutations="buildPermutations(permutable_attributes)"><kc-permutable-input name="name" type="text" required="required">Name</kc-permutable-input><kc-permutable-input name="description" type="text">Description</kc-permutable-input></kc-permutable-attributes></div><div class="col-lg-4 col-md-4 col-sm-6"><div class="well"><h4>{{widgets.length}} Widgets Built</h4><h5>Name ({{state.permutable_attributes.name.length}})</h5><ul class="list-unstyled"><li ng-repeat="name in state.permutable_attributes.name">{{name}}</li></ul><h5>Description ({{state.permutable_attributes.description.length}})</h5><ul class="list-unstyled"><li ng-repeat="description in state.permutable_attributes.description">{{description}}</li></ul><button type="button" ng-click="submit()" ng-disabled="widgets.length === 0" class="btn btn-default">Submit</button></div></div></div>'),$templateCache.put("/permutation/_permutable-input.html",'<form ng-submit="submit()" name="form" ng-class="{ \'has-error\': form.$invalid &amp;&amp; form.value.$touched }" class="form-group"><label for="{{input_id}}" class="control-label"><span ng-transclude="ng-transclude"></span><span ng-if="state.is_required">*</span></label><div class="input-group"><input id="{{input_id}}" name="value" type="text" ng-model="state.value" ng-required="isRequired()" class="form-control"/><div class="input-group-btn"><button type="submit" ng-disabled="isDisabled()" class="btn btn-default">Add</button></div></div></form>')}]);